export default function dateRomania(date) {
  let dateToFormat = new Date(date).getDate();
  let day = dateToFormat.getDay();
  let month = dateToFormat.getMonth()
  let year = dateToFormat.getFullYear();
  return day+"."+month+"."+year;
}
